import React, { memo } from 'react';
import { Handle, Position, NodeProps } from 'reactflow';
import { Box, Typography, Paper } from '@mui/material';
import ApiIcon from '@mui/icons-material/Api';
import { ApiNode as ApiNodeType } from '../types';

// Custom node component for API nodes
const ApiNode = ({ data }: NodeProps) => {
  const api = data.api as ApiNodeType;

  return (
    <Paper 
      elevation={2}
      sx={{
        padding: 2,
        borderRadius: 2,
        minWidth: 180,
        backgroundColor: '#fff8e6',
        border: '2px solid #f57c00',
        '&:hover': {
          boxShadow: 3,
        }
      }}
    >
      {/* Target handle - only allow incoming connections */}
      <Handle
        type="target"
        position={Position.Left}
        style={{ background: '#f57c00', width: 10, height: 10 }}
      />

      <Box sx={{ display: 'flex', alignItems: 'center', gap: 1, mb: 1 }}>
        <ApiIcon color="warning" />
        <Typography variant="subtitle1" fontWeight="bold">
          {api ? api.name : data.label}
        </Typography>
      </Box>

      <Typography variant="body2" color="text.secondary">
        {api ? api.description : 'API Node'}
      </Typography>

      {/* No source handle - APIs cannot have outgoing connections */}
    </Paper>
  );
};

export default memo(ApiNode);
